import tkinter as tk
from tkinter import filedialog, messagebox
from pathlib import Path
import shutil
import os
from AES import aes_cbc_encrypt, aes_cbc_decrypt, adjust_key_length, pkcs7_pad, pkcs7_unpad
from PIL import Image, ImageTk
import base64
import io

# GUI部分
    
def select_source_folder():
    source_path.set(filedialog.askdirectory())

def select_destination_folder():
    destination_path.set(filedialog.askdirectory())

def process_files():
    operation = operation_var.get()
    source = source_path.get()
    destination = destination_path.get() or source  # 如果目标文件夹未指定，则使用源文件夹
    key = key_entry.get().encode()

    try:
        for item in Path(source).rglob('*'):
            if item.is_file():
                source_item = str(item)
                destination_item = str(Path(destination) / item.relative_to(source))

                with open(item, 'rb') as f_in:
                    data = f_in.read()
                    if operation == 'encrypt':
                        padded_data = pkcs7_pad(data, 16)
                        encrypted_data = aes_cbc_encrypt(padded_data, adjust_key_length(key))
                    elif operation == 'decrypt':
                        ciphertext = data
                        decrypted_data = aes_cbc_decrypt(ciphertext, adjust_key_length(key))
                        unpadded_data = pkcs7_unpad(decrypted_data)
                        if unpadded_data is None:  # 处理解密后的数据可能的错误
                            continue
                        decrypted_data = unpadded_data
                    else:
                        messagebox.showerror("Error", "Invalid operation.")
                        return
                
                # 检查并删除目标文件夹中同名文件或目录
                if os.path.exists(destination_item):
                    os.remove(destination_item)
                
                with open(destination_item, 'wb') as f_out:
                    f_out.write(decrypted_data if operation == 'decrypt' else encrypted_data)

        messagebox.showinfo("Success", f"{operation.capitalize()}ion completed.")
    except Exception as e:
        messagebox.showerror("Error", str(e))
  
# base64 编码的图片字符串（将你的 base64 字符串粘贴在这里）
base64_image = ""

# 将 base64 编码的字符串转换为二进制数据
image_data = base64.b64decode(base64_image)

# 将二进制数据转换为图片对象
image = Image.open(io.BytesIO(image_data))
      
# 初始化Tkinter窗口
app = tk.Tk()
app.title("Folder Encryption & Decryption Tool")

# 禁止调整窗口大小
app.resizable(False, False)

# 禁止全屏
app.attributes("-fullscreen", False)

# 添加背景图片
bg_photo = ImageTk.PhotoImage(image)
canvas = tk.Canvas(app, width=image.width, height=image.height)
canvas.create_image(0, 0, anchor="nw", image=bg_photo)
canvas.pack(fill="both", expand=True)

# 用户输入框和按钮定义
source_path = tk.StringVar()
destination_path = tk.StringVar()
key_entry = tk.Entry(app)
operation_var = tk.StringVar(value="encrypt")  # 默认选择加密

source_button = tk.Button(app, text="Select Source Folder", command=select_source_folder, bg="lightgray")
destination_button = tk.Button(app, text="Select Destination Folder", command=select_destination_folder, bg="lightgray")
process_button = tk.Button(app, text="Process", command=process_files, bg="lightgray")

encrypt_radio = tk.Radiobutton(app, text="Encrypt", variable=operation_var, value="encrypt", bg="lightgray")
decrypt_radio = tk.Radiobutton(app, text="Decrypt", variable=operation_var, value="decrypt", bg="lightgray")

# 布局
source_label = tk.Label(app, text="Source Folder:", bg="lightgray")
source_label.place(relx=0.1, rely=0.2)
source_entry = tk.Entry(app, textvariable=source_path, state='readonly')
source_entry.place(relx=0.3, rely=0.2)
source_button.place(relx=0.7, rely=0.2)

destination_label = tk.Label(app, text="Destination Folder:", bg="lightgray")
destination_label.place(relx=0.1, rely=0.3)
destination_entry = tk.Entry(app, textvariable=destination_path, state='readonly')
destination_entry.place(relx=0.3, rely=0.3)
destination_button.place(relx=0.7, rely=0.3)

key_label = tk.Label(app, text="Encryption Key:", bg="lightgray")
key_label.place(relx=0.1, rely=0.4)
key_entry.place(relx=0.3, rely=0.4)

operation_label = tk.Label(app, text="Operation:", bg="lightgray")
operation_label.place(relx=0.1, rely=0.5)
encrypt_radio.place(relx=0.3, rely=0.5)
decrypt_radio.place(relx=0.5, rely=0.5)

process_button.place(relx=0.4, rely=0.6)

# 运行GUI主循环
app.mainloop()
